//Define lcd io
sbit CS=P1^0;		//chip select when low
sbit RS=P1^1;		//high :data  low:command    
sbit SCL=P1^7;		//SERIAL CLOCK INPUT    
sbit SDI=P1^5;	     //SERIAL DATA INPUT   
sbit SDO=P1^6;	     //SERIAL DATA OUTPUT  
sbit RES=P3^7;		//reset
sbit BL_ON=P3^0;    //Blacklight Control     H:ON   L:OFF

