//===============================================================
// all display one colour
void ClearScreen(unsigned int bColor)
{
 unsigned int i,j;
 LCD_SetPos(0,239,0,319);//320x240
 for (i=0;i<320;i++)
	{
	
	   for (j=0;j<240;j++)
	       Write_Data_U16(bColor);
	}
}


//===============================================================
//write parameter
void  Write_Cmd_Data (unsigned char CMDP)
{ unsigned char i;
 	 
    CS=0;
   	RS=1;
    for(i=0;i<8;i++)
     {  SCL=0;
        if(CMDP&0x80) SDI=1;
       	else SDI=0;
       	SCL=1;
        CMDP=CMDP<<1;
     }
   	CS=1;

}


//==============================================================
//write  data word
void  Write_Data_U16(unsigned int y)
{
	unsigned char m,n;
	m=y>>8;
	n=y;
	Write_Data(m,n);

}
//=============================================================
//write command

void Write_Cmd(unsigned char CMD)
{ unsigned char i;
 	 
    CS=0;
   	RS=0;
    for(i=0;i<8;i++)
     {  SCL=0;
        if(CMD&0x80) SDI=1;
       	else SDI=0;
       	SCL=1;
        CMD=CMD<<1;
     }
   	CS=1;


}

//===================================================================
//write data byte

void Write_Data(unsigned char DH,unsigned char DL)
{unsigned char i;
 	 
    CS=0;
   	RS=1;
    for(i=0;i<8;i++)
     {  SCL=0;
        if(DH&0x80) SDI=1;
       	else SDI=0;
       	SCL=1;
        DH=DH<<1;
     }

    for(i=0;i<8;i++)
     {  SCL=0;
        if(DL&0x80) SDI=1;
       	else SDI=0;
       	SCL=1;
        DL=DL<<1;
     }

   	CS=1;

}




//============================================================
//delay 
void delayms(unsigned int count)
{
    int i,j;                                                                                
    for(i=0;i<count;i++)                                                                    
       {
	     for(j=0;j<125;j++);
       }                                                                                     
}


//============================================================

void LCD_FULL(unsigned int i)
{//show Box
    unsigned int w,u;
 LCD_SetPos(0,239,0,319);//320x240

	    for(w=0;w<240;w++)
		{    
          	Write_Data_U16(~i);

		}

  	for(w=0;w<318;w++)		    
        {  	Write_Data_U16(~i);
	    	
			for(u=0;u<238;u++)
         	Write_Data_U16(i);

          	Write_Data_U16(~i);		
		}

	    for(w=0;w<240;w++)
		{    
          	Write_Data_U16(~i);

		}	
	
}


//============================================================
//show gray

void DispRGBGray(void)
{  

	unsigned int  A,B,C;
    unsigned int  i,j,k,DH;

 LCD_SetPos(0,239,0,319);//320x240



	for(k=0;k<80;k++)
	{   
    	A=0;
    	B=0;
    	C=0;
		for(i=0;i<16;i++)
		{    
    		for(j=0;j<15;j++)
    		{
     			DH=(A<<11)+(B<<5)+C;
     			Write_Data_U16(DH);
    		}
    		A=A+2;
   			B=B+4;
    		C=C+2;
  		}

	}


	for(k=0;k<80;k++)
	{   
    	A=0;
    	B=0;
    	C=0;
		for(i=0;i<16;i++)
		{    
    		for(j=0;j<15;j++)
    		{
     			DH=(A<<11)+B+C;
     			Write_Data_U16(DH);
    		}
    		A=A+2;

  		}

	}

	for(k=0;k<80;k++)
	{   
    	A=0;
    	B=0;
    	C=0;
		for(i=0;i<16;i++)
		{    
    		for(j=0;j<15;j++)
    		{
     			DH=A+(B<<5)+C;
     			Write_Data_U16(DH);
    		}
    		B=B+4;

  		}

	}

	for(k=0;k<80;k++)
	{   
    	A=0;
    	B=0;
    	C=0;
		for(i=0;i<16;i++)
		{    
    		for(j=0;j<15;j++)
    		{
     			DH=A+B+C;
     			Write_Data_U16(DH);
    		}
    		C=C+2;

  		}

	}




}

