void show_picture(void)
{
	unsigned char i,j;
	unsigned int m=0,n=0;
 LCD_SetPos(0,239,0,319);//320x240
	for(j=0;j<160;j++)
	{
        for(i=0;i<120;i++)
		{
            Write_Data_U16(pic[m++]);
	    }
		for(i=0;i<120;i++)
		{
            Write_Data_U16(pic[n++]);
	    }
	}

   	m=0;
   	n=0;
	for(j=0;j<160;j++)
	{
        for(i=0;i<120;i++)
		{
            Write_Data_U16(pic[m++]);
	    }
		for(i=0;i<120;i++)
		{
            Write_Data_U16(pic[n++]);
	    }
	}

	


    return;
}



